import './App.css';
import Axios from 'axios'
import Header from './components/Header';
import React,{useState,useEffect} from 'react';
import ExpandableList from './components/ExpandableList';

function App() {
  const project_list=[
    "http://investor.weyerhaeuser.com/events-and-presentations",
    "https://investor.fb.com/investor-events/",
    "https://informacioncorporativa.entel.cl/investors/presentations",
    "http://ir.homedepot.com/events-and-presentations"
  ]
  const [scraps,setScraps]=useState([])

  useEffect(() => {

    fetchScraps();

  }, [])

  useEffect(() => {

    console.log(scraps)

  }, [scraps])

  const fetchScraps=async()=>{

    const response=await Axios('http://localhost:8000/');

    setScraps(response.data)    

  }
  return (

    <div className="container">
      <Header title="Standalone Project"/>
      <ExpandableList title={project_list[0]} content={scraps.filter(x=>x.company_code===0)}/>
      <ExpandableList title={project_list[1]} content={scraps.filter(x=>x.company_code===1)}/>
      <ExpandableList title={project_list[2]} content={scraps.filter(x=>x.company_code===2)}/>
      <ExpandableList title={project_list[3]} content={scraps.filter(x=>x.company_code===3)}/>
    </div>

  );

}


export default App;
